import React from "react";
import { Router, Switch, Route } from "react-router-dom";
import Landing from "./components/Landing";
import "tailwindcss/tailwind.css";

function App() {
  return (
    <Router history={history}>
      <Switch>
        <Route exact path="/" component={Landing} />
      </Switch>
    </Router>
  );
}

export default App;
